// Libraries
import React from 'react'
import PropTypes from 'prop-types'

const Tooltip = ({ className, tooltip, children }) => (
  <div className={`icon-button tooltip-width `}>
    {tooltip ? <span className={`tooltip ${className}`}>{tooltip}</span> : null}
    {children}
  </div>
)

Tooltip.propTypes = {
  className: PropTypes.string,
  tooltip: PropTypes.string
}

Tooltip.defaultProps = {
  className: '',
  tooltip: ''
}

export default Tooltip
